import './index.css';
import { Component } from 'react';

class Todo extends Component {
  render() {
	  const render_tab = this.props.all_task.map((data, key) =>
	  {
		  return(
			<div className='card'>
				<h2>{data}</h2>
				<div className='actions'>
			  		<button className='btn'>Delete</button>
				</div>
		  	</div>
		  )
	  })
	  return (
	  <body>render_tab</body>
	  )
}

}

export default Todo;
